import React, { Component } from "react";

class footer extends Component {
  render() {
    return (
      <div className="container-fluid" id="footer">
        <div className="container">
          <ul className="nav">
            <li className="nav-item">
              <Link to="/"></Link>
            </li>
          </ul>
        </div>
      </div>
    );
  }
}

export default footer;
